func (m *DeviceData) DeepCopyIn(src *DeviceData) {
	if src.Devices != nil {
		m.Devices = make([]Device, len(src.Devices), len(src.Devices))
		for ii, s := range src.Devices {
			m.Devices[ii].DeepCopyIn(&s)
		}
	} else {
		m.Devices = nil
	}
}

